import React from 'react';
import { Link } from 'react-router-dom';
import './public/LandingPage.css';

function LandingPage() {
    return (
        <div className="landing-page">
            <div className="left-section">
                <h1>Welcome, to <br /> Edumentor</h1>
                <img src="student-mentor.png" alt="Student Illustration" className="illustration" />
            </div>

            <div className="right-section">
                <h3>Select your role</h3>
                <div className="role-selection">
                    <Link to="/login" className="role-button">Student</Link>
                    <Link to="/mentorlogin" className="role-button">Mentor</Link>
                </div>
            </div>
        </div>
    );
}

export default LandingPage;
